export async function fetchTodayCount() {
  try {
    const res = await fetch('https://script.google.com/macros/s/AKfycbxA7aWxExp-ZXsFAooa6E446_V-I40ugFqjmWC87hhttfUTN-z6o4fH6QQH6CLYSJVv9g/exec');
    const data = await res.json();
    return Array.isArray(data) ? data.length : 0;
  } catch (e) {
    return 0;
  }
}
